    function parsePriceRange(priceRange) {
        const rangeMatch = priceRange.match(/(\d+(\.\d+)?)-(\d+(\.\d+)?)/);
        if (rangeMatch) {
            return {
                min: parseFloat(rangeMatch[1]),
                max: parseFloat(rangeMatch[3])
            };
        }
        const singleValueMatch = priceRange.match(/(\d+(\.\d+)?)/);
        if (singleValueMatch) {
            const value = parseFloat(singleValueMatch[1]);
            return { min: value, max: value };
        }
        return { min: 0, max: 0 };
    }

function getValueFromDateAndRarity(kID, date, rarity) {
    let year;

    for (const [yr, kIDList] of Object.entries(kIDYearTable)) {
        if (kIDList.includes(kID)) {
            year = yr;
            break;
        }
    }

    if (!year) {
        year = date.split('-')[0];
    }

    const rarityValue = rarityValues[rarity];

    if (!rarityValue || !valueTable[rarityValue] || !valueTable[rarityValue][year]) {
        return "1C$";
    }
    return valueTable[rarityValue][year];
}


