function extractValuesExistingTrade(petBlocks) {
    let minTotal = 0;
    let maxTotal = 0;
    let MATotal = 0;
    let MAC$min = 0;
    let MAC$max = 0;
    let hasTrueDateWarning = false;
    let hasRereleaseWarning = false;

    petBlocks.forEach(petBlock => {
        const valueText = petBlock.querySelector('.pet-value') ? petBlock.querySelector('.pet-value').textContent : null;
        if (valueText) {
            const fullMatch = valueText.match(/([\d.]+)\s*MA\s*\((\d+)-(\d+)C\$?\)/i);
            const rangeMatch = valueText.match(/(\d+(?:\.\d+)?)-(\d+(?:\.\d+)?)C\$?/);
            const singleValueMatch = valueText.match(/^(\d+(?:\.\d+)?)C\$?/);



            if (fullMatch) {
                const MAamount = parseFloat(fullMatch[1]);
                const minC = parseInt(fullMatch[2]);
                const maxC = parseInt(fullMatch[3]);
                MATotal += MAamount;
                MAC$min += minC;
                MAC$max += maxC;
            } else if (rangeMatch) {
                const minValue = parseFloat(rangeMatch[1]);
                const maxValue = parseFloat(rangeMatch[2]);
                minTotal += minValue;
                maxTotal += maxValue;
            } else if (singleValueMatch) {
                const value = parseFloat(singleValueMatch[1]);
                minTotal += value;
                maxTotal += value;
            }

            const dateText = petBlock.innerHTML.match(/(\d{4}-\d{2}-\d{2})/);
            const rarityImg = petBlock.querySelector('.rarity-bar');
            const rarityClass = rarityImg ? rarityImg.classList[1] : null;
            const rarity = rarityClass ? rarityValues[rarityClass] : null;

            if (dateText) {
                const year = dateText[0].split('-')[0];
                if (["2008", "2009"].includes(year) &&
                    (rarity === "OMG so rare!" || rarity === "Extremely rare")) {
                    hasTrueDateWarning = true;
                }
            }

        }
    });
    MATotal = Math.round((MATotal + Number.EPSILON) * 100) / 100;

    return { minTotal, maxTotal, MATotal, MAC$min, MAC$max, hasTrueDateWarning };
}

