function extractValuesGroupPage() {
    const petValues = document.querySelectorAll('li dl.pet .pet-value');

    let minTotal = 0;
    let maxTotal = 0;
    let MATotal = 0;
    let MAC$min = 0;
    let MAC$max = 0;

    petValues.forEach(val => {
        const valueText = val.textContent;
        const rangeMAMatch = valueText.match(/(\d+(?:\.\d+)?)-(\d+(?:\.\d+)?)\s*MA\s*\((\d+)-(\d+)C\$?\)/i);
        const upToMAMatch = valueText.match(/up to\s+(\d+(?:\.\d+)?)\s*MA\s*\((\d+)-(\d+)C\$?\)/i);
        const singleMAMatch = valueText.match(/(\d+(?:\.\d+)?)\s*MA\s*\((\d+)-(\d+)C\$?\)/i);
        const rangeMatch = valueText.match(/(\d+(?:\.\d+)?)-(\d+(?:\.\d+)?)C\$?/);
        const singleValueMatch = valueText.match(/^(\d+(?:\.\d+)?)C\$?/);

        if (rangeMAMatch) {
            const minC = parseInt(rangeMAMatch[3]);
            const maxC = parseInt(rangeMAMatch[4]);
            MATotal += parseFloat(rangeMAMatch[2]);
            MAC$min += minC;
            MAC$max += maxC;
        } else if (upToMAMatch) {
            const minC = parseInt(upToMAMatch[2]);
            const maxC = parseInt(upToMAMatch[3]);
            MATotal += parseFloat(upToMAMatch[1]);
            MAC$min += minC;
            MAC$max += maxC;
        } else if (singleMAMatch) {
            const minC = parseInt(singleMAMatch[2]);
            const maxC = parseInt(singleMAMatch[3]);
            MATotal += parseFloat(singleMAMatch[1]);
            MAC$min += minC;
            MAC$max += maxC;
        } else if (rangeMatch) {
            minTotal += parseFloat(rangeMatch[1]);
            maxTotal += parseFloat(rangeMatch[2]);
        } else if (singleValueMatch) {
            const value = parseFloat(singleValueMatch[1]);
            minTotal += value;
            maxTotal += value;
        }
    });

    return { minTotal, maxTotal, MATotal, MAC$min, MAC$max };
}

function processGroupPagePets() {
    const petBlocks = document.querySelectorAll('li dl.pet');
    if (petBlocks.length === 0) return;

    petBlocks.forEach(petBlock => {
        const img = petBlock.querySelector('img');
        if (!img) return;

        if (/\/pet\/\d+&trans=1\.jpg$/i.test(img.src)) {
            let existingValue = petBlock.querySelector('.pet-value');
            if (!existingValue) {
                const val = document.createElement('div');
                val.className = 'pet-value';
                val.style.marginTop = "2px";
                val.style.display = showGroupValues ? "block" : "none";

                const wrapper = document.createElement('span');
                wrapper.style.textDecoration = "underline dotted";
                wrapper.style.cursor = "help";
                wrapper.textContent = " Dressed up";

                const tooltip = document.createElement('div');
                tooltip.textContent = "Dressed up pets have a different image link then regular pet images, and therefore are unable to be properly identified";
                tooltip.style.position = "absolute";
                tooltip.style.background = "#fff";
                tooltip.style.border = "1px solid #ccc";
                tooltip.style.padding = "6px";
                tooltip.style.borderRadius = "4px";
                tooltip.style.boxShadow = "0 2px 5px rgba(0,0,0,0.15)";
                tooltip.style.maxWidth = "220px";
                tooltip.style.fontSize = "12px";
                tooltip.style.display = "none";
                tooltip.style.zIndex = "9999";
                wrapper.style.position = "relative";

                wrapper.addEventListener('mouseenter', () => {
                    tooltip.style.display = "block";
                });
                wrapper.addEventListener('mouseleave', () => {
                    tooltip.style.display = "none";
                });

                wrapper.appendChild(tooltip);
                val.appendChild(wrapper);
                const rarityRow = petBlock.querySelector('.pet-rarity-row');
                if (rarityRow) rarityRow.appendChild(val);
                else petBlock.appendChild(val);
            }
            return;
        }

        const imgSrc = img.src;
        const kIDMatch = imgSrc.match(/k=([^&]+)/);
        const kID = kIDMatch ? kIDMatch[1] : null;
        const storedValue = kID ? infoData[kID] : null;

        let finalValue = storedValue;
        const dateEl = petBlock.querySelector('.pet-adoption-date');
        const dateText = dateEl ? dateEl.textContent.trim() : null;

        let rarityKey = null;
        let rarityText = null;
        const rarityBar = petBlock.querySelector('.rarity-bar');
        if (rarityBar) {
            rarityKey = rarityBar.classList[1];
            rarityText = rarityValues[rarityKey];
        } else {
            const rarityTextEl = petBlock.querySelector('.pet-rarity-row .pet-rarity');
            if (rarityTextEl) {
                rarityText = rarityTextEl.textContent.trim();
                rarityKey = Object.keys(rarityValues)
                    .find(key => rarityValues[key].toLowerCase() === rarityText.toLowerCase());
            }
        }
        if (!finalValue && dateText && rarityKey) {
            finalValue = getValueFromDateAndRarity(kID, dateText, rarityKey);
        }
        if (!finalValue) finalValue = "1C$";

        let existingValue = petBlock.querySelector('.pet-value');
        if (!existingValue) {
            const val = document.createElement('div');
            val.className = 'pet-value';
            val.style.marginTop = "2px";
            val.textContent = finalValue;
            val.style.display = showGroupValues ? "block" : "none";
            const rarityRow = petBlock.querySelector('.pet-rarity-row');
            if (rarityRow) rarityRow.appendChild(val);
            else petBlock.appendChild(val);
        } else {
            existingValue.style.display = showGroupValues ? "block" : "none";
        }
    });

    if (window.updateGroupTotalButton) {
        window.updateGroupTotalButton();
    }
}

function injectGroupValueToggleButton() {
    const renamePanelDisabled = document.querySelector('.rename-pets-disabled');
    const renamePanelEnabled = document.querySelector('.rename-pets-enabled');
    const renamePanel = renamePanelDisabled || renamePanelEnabled;
    if (!renamePanel) return;
    if (document.querySelector('.btn-toggle-values')) return;

    const leftCell = renamePanel.closest('td').parentElement.children[0];
    if (!leftCell) return;

    const pagesDiv = leftCell.querySelector('.pages'); // KEEP PAGINATION
    let totalContainer = leftCell.querySelector('.group-total-container');

    if (!totalContainer) {
        totalContainer = document.createElement('div');
        totalContainer.className = 'group-total-container';
        totalContainer.style.marginTop = "4px";
        leftCell.appendChild(totalContainer);
    }

    const totalText = document.createElement('span');
    totalText.className = 'group-total-text';
    totalContainer.appendChild(totalText);

    const toggleBtn = document.createElement('button');
    toggleBtn.className = 'btn-toggle-values';
    toggleBtn.textContent = 'Show Pet Values';
    toggleBtn.style.marginRight = "8px";
    const renameBtn = renamePanelDisabled?.querySelector('.btn-rename-pets');
    if (renameBtn) renamePanelDisabled.insertBefore(toggleBtn, renameBtn);

    if (renamePanelEnabled) {
        const toggleBtn2 = toggleBtn.cloneNode(true);
        toggleBtn2.classList.add('btn-toggle-values-enabled');
        const firstEnabledBtn = renamePanelEnabled.querySelector('button');
        renamePanelEnabled.insertBefore(toggleBtn2, firstEnabledBtn);
    }

    function formatNumber(n) {
        return n.toFixed(2).replace(/\.?0+$/, '');
    }

    function updateGroupTotal() {
        const { minTotal, maxTotal, MATotal, MAC$min, MAC$max } = extractValuesGroupPage();
        const totalMin = minTotal + MAC$min;
        const totalMax = maxTotal + MAC$max;
        let txt = `Page Total: ${formatNumber(totalMin)}-${formatNumber(totalMax)} C$`;
        const details = [];
        if (MATotal > 0) {
            let maText = `${formatNumber(MATotal)} MA`;
            if (MAC$min > 0 || MAC$max > 0) {
                maText += ` [${formatNumber(MAC$min)}-${formatNumber(MAC$max)} C$]`;
            }
            details.push(maText);
        }
        if (minTotal > 0 || maxTotal > 0) {
            let regText = (minTotal === maxTotal)
                ? `${formatNumber(minTotal)} C$`
                : `${formatNumber(minTotal)}-${formatNumber(maxTotal)} C$`;
            details.push(`Regular Pets: ${regText}`);
        }
        if (details.length > 0) totalText.innerHTML = txt + "<br>(" + details.join(', ') + ")";
        else totalText.textContent = txt;
    }

    window.updateGroupTotalButton = updateGroupTotal;
    updateGroupTotal();

    function runToggle() {
        showGroupValues = !showGroupValues;
        document.querySelectorAll('.btn-toggle-values, .btn-toggle-values-enabled')
            .forEach(btn => btn.textContent = showGroupValues ? "Hide Pet Values" : "Show Pet Values");
        document.querySelectorAll('li dl.pet .pet-value')
            .forEach(val => val.style.display = showGroupValues ? "block" : "none");
        updateGroupTotal();
    }

    toggleBtn.addEventListener('click', runToggle);
    const enabledBtn = document.querySelector('.btn-toggle-values-enabled');
    if (enabledBtn) enabledBtn.addEventListener('click', runToggle);
}

